import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import ReactPlayer from 'react-player'
import juliasession from './videos/julia_session_nv.mp4'
import nancysession from './videos/nancy_session_nv.mp4'
import audio from './videos/discussion_nv.m4a'
import Fab from '@material-ui/core/Fab';
import RoomIcon from '@material-ui/icons/Room';
import CallEndIcon from '@material-ui/icons/CallEnd';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { Typography, Button } from '@material-ui/core';
import Tooltip from '@material-ui/core/Tooltip';
import Icon from '@material-ui/core/Icon';
import pin from './videos/pin.svg'

const useStyles = makeStyles({
  root: {
    display: 'flex',
    alignItems: 'center',
  },
  imageIcon: {
    height: '100%'
  },
  iconRoot: {
    textAlign: 'center'
  }
});

export default function Call () {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Grid container alignItems="center">
      <Grid
      container
      direction="row"
      justify="center"
      alignItems="flex-start"
      >
        <div></div>
        <div>
          <Paper style={{padding:10, marginTop:10, marginBottom:10}}>
        <ReactPlayer
        playing='true'
        url= {juliasession}
        />
        <Typography variant='caption'>Julia Rogers</Typography>
        </Paper>
        <Tooltip title="Pinned at 0:30" placement="top">
        <Fab color="primary" aria-label="add">
          <RoomIcon />
          </Fab>
          </Tooltip>
          <Button variant="contained" color="secondary" startIcon={<CallEndIcon fontSize="large" />} style={{marginLeft:150, marginTop:10}}>
          Begin Discussion Prep
        </Button>
        </div>
        <ReactPlayer
        playing='true'
        url= {nancysession}
        width='10%'
        height='10%'
        />

        </Grid>
        <Grid item xs={4}>
        </Grid>
        <Grid item>

        </Grid>

        </Grid>

    </div>
  )}
